import { StyleSheet, Text, View, TouchableWithoutFeedback } from 'react-native';
import gameEngine from './components/gameEngine'

export default function App() {

  return (
    <gameEngine/>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
